import React from 'react'
import Loading from '../components/Loading/index'
import Grid from '@material-ui/core/Grid';

export default {
  title: 'Loading',
  component: Loading
}

export function FelixLoader() {

  return (
    <div> 
    <Grid
        container
        direction="row"
        justify="left"
        alignItems="center"
        style={{ height: '100vh', backgroundColor: '#fafafa' }}
      >
        <Loading />
      </Grid>
    </div>
  )
}
